private static Explanation findExplanation(Explanation expl, String text) {
  if (expl.getDescription().equals(text)) {
    return expl;
  } else {
    for (Explanation sub : expl.getDetails()) {
      Explanation match = findExplanation(sub, text);
      if (match != null) {
        return match;
      }
    }
  }
  return null;
}

